// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

/// Library imports
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Founder {

    enum FounderStatus {
		Active,
		Sold,
		Cancelled,
        Frozen
	}

    struct Founders {
        FounderStatus status;
        address seller;
        address token;
        uint256 tokenId;
        uint256 price;
        uint256 timeToUse;
    }

    mapping(uint256 => Founders) public founders;
    uint256 private foundersId = 0;

    function getFounder(uint256 _foundersId) public view returns (Founders memory)  {
        return founders[_foundersId];
    }

    function setFounder(address token, uint tokenId, uint price) external returns (address) {
        Founders memory founder = Founders(
            FounderStatus.Frozen,
            msg.sender,
            token,
            tokenId,
            price,
            (block.timestamp + (365 days) / 2)
        );

        ++foundersId;
        founders[foundersId] = founder;
        return token;
    }  
}
